import { createContext, useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './Component/Router/Home';
import Page from './Component/Router/Page';
import UseParam from './Component/Router/UseParam';
import Redux from './Component/Redux/Redux';
import LayoutMain from './Component/Layouts/LayoutMain';
import UseState from './Component/Hook/UseState';
import UseEffectDeCo from './Component/Hook/UseEffectDeCo';
import UseEffectKhongDe from './Component/Hook/UseEffectKhongDe';
import UseEffectDeRong from './Component/Hook/UseEffectDeRong';
import UseMemo from './Component/Hook/UseMemo';
import UseContext from './Component/Hook/UseContext';

function App() {

  return (
    <Router>
      <LayoutMain>
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/page' element={<Page />} />
          <Route path='/param/:id' element={<UseParam />} />
          <Route path='/redux' element={<Redux />} />
          <Route path='/usestate' element={<UseState />} />
          <Route path='/usememo' element={<UseMemo />} />
          <Route path='/usecontext' element={<UseContext />} />


          <Route path='/useeffect' element={<UseEffectDeCo />} />
          <Route path='/useeffect-none' element={<UseEffectKhongDe />} />
          <Route path='/useeffect-empty' element={<UseEffectDeRong />} />

        </Routes>
      </LayoutMain>
    </Router>
  );
}
export default App;
